function executeTracking(callback) {
    if (!fbqPresent()) {
        return false;
    }
    callback();
    return true;
}

function fbqPresent() {
    return (typeof fbq !== 'undefined' && fbq);
}

function trackFBEvent(callback) {
    // Try immediately
    if (executeTracking(callback)) {
        return;
    }

    // Retry every second for up to 10 seconds
    var attempts = 0;
    var maxAttempts = 10;

    var intervalId = setInterval(function() {
        attempts++;
        if (executeTracking(callback) || attempts >= maxAttempts) {
            clearInterval(intervalId);
            if (attempts >= maxAttempts) {
                console.warn('Facebook Pixel tracking failed after ' + maxAttempts + ' attempts');
            }
        }
    }, 1000);
}

