    // If no start time is stored, this is the first page view of the session.
    if (!sessionStartTime) {
      sessionStartTime = new Date().getTime().toString();
      sessionStorage.setItem('session_start_time', sessionStartTime);
    }

    // If the event has already fired this session, do nothing more.
    if (eventFired === 'true') {
      return;
    }

    // Check the elapsed time every 5 seconds.
    var intervalCheck = setInterval(function() {
      var currentTime = new Date().getTime();
      var elapsedTime = currentTime - parseInt(sessionStartTime);

      if (elapsedTime >= timeThreshold) {
        window.dataLayer = window.dataLayer || [];
        window.dataLayer.push({
          'event': dataLayerEventName
        });

        // Set a flag to ensure the event only fires once per session.
        sessionStorage.setItem('time_on_site_event_fired', 'true');
        // Stop the timer from running further.
        clearInterval(intervalCheck);
