if (Element.prototype.closest === undefined) {
    Element.prototype.closest = function(selector) {
        var element = this;
        while (element) {
            if (element.matches(selector)) {
                return element;
            }
            element = element.parentElement;
        }
        return null;
    };
}

function registerPopupOfferEvent(action) {
	window.dataLayer = window.dataLayer || [];
	var dlData = {
		'event': 'popup',
		'popup_action': action
	};
	window.dataLayer.push(dlData);
}

function registerClosePopupOffer(el) {
	if (el.parentElement.classList.contains('ltkpopup-no-thanks')) {
		registerPopupOfferEvent('no thanks');
		return;
	}
	registerPopupOfferEvent('x');
}

function registerSubscribePopupOffer(el) {
	var formContainer = el.closest('.ltkpopup-form-contain');
	if (!formContainer || formContainer.length === 0) {
		return;
	}

	var emailField = formContainer.querySelector('#ltkpopup-email');
	if (!emailField) {
		return;
	}

	if (emailField.checkValidity()) {
		registerPopupOfferEvent('signup');
	}
}

document.addEventListener('click', function(e) {
	if (e.target.classList.contains('ltkpopup-close')) {
		registerClosePopupOffer(e.target);
		return;
	}

	if (e.target.classList.contains('ltkpopup-subscribe')) {
		registerSubscribePopupOffer(e.target);
		return;
	}

	var button = e.target.closest('button.ltkpopup-close');
	if (button) {
		registerClosePopupOffer(button);
		return;
	}
});
</script>","supportDocumentWrite":"false"}

