{"html":"<script>

/**
 * Element.closest() polyfill --- closest() does not work in IE
 * https://developer.mozilla.org/en-US/docs/Web/API/Element/closest#Polyfill
 */
 if (!Element.prototype.closest) {
	if (!Element.prototype.matches) {
		Element.prototype.matches = Element.prototype.msMatchesSelector || Element.prototype.webkitMatchesSelector;
	}
	Element.prototype.closest = function (s) {
		var el = this;
		var ancestor = this;
		if (!document.documentElement.contains(el)) return null;
		do {
			if (ancestor.matches(s)) return ancestor;
			ancestor = ancestor.parentElement;
		} while (ancestor !== null);
		return null;
	};
}

function trackHTML5Video(el) {
	if (!el) {
		return;
	}

    // this may be causing double reporting with cHTML - Video Tracking
	//el.addEventListener('progress', recordHTML5VideoEvent);
	el.addEventListener('play', recordHTML5VideoEvent);
	el.addEventListener('pause', recordHTML5VideoEvent);
	el.addEventListener('ended', recordHTML5VideoEvent);
}
function getHTML5VideoTitle(el) {
	if (!el) {
		return;
	}

	var fullWidth = el.closest('sn-cms-sn-full-width-video-landing-page');
	if (fullWidth) {
		return getFullWidthHTML5VideoTitle(fullWidth);
	}

	var infoBlock = el.closest('sn-cms-sn-cream-landing-page-info-video-block');
	if (infoBlock) {
		return getInfoBlockHTML5VideoTitle(infoBlock);
	}

	var cmsVideo = el.closest('ish-cms-video');
	if (cmsVideo) {
		return getCMSHTML5VideoTitle(cmsVideo);
	}

	return '';
}
function getCMSHTML5VideoTitle(el) {
	if (!el) {
		return;
	}

	var pagelet = el.parentElement.previousSibling;
	if (!pagelet) {
		return;
	}

	var tag = pagelet.tagName.toLowerCase();
	if (!tag || tag !== 'ish-content-pagelet') {
		return;
	}

	// find the first heading of levels 1 or 2
	var heading = pagelet.querySelector('h1, h2');
	if (!heading) {
		return;
	}

	return heading.innerText;
}
function getInfoBlockHTML5VideoTitle(el) {
	if (!el) {
		return;
	}

	// find the first heading of levels 1 or 2
	var heading = el.querySelector('.video-desc h1, .video-desc h2');
	if (!heading) {
		return;
	}

	return heading.innerText;
}
/**
 * pull the heading from the previous pagelet
 * of the parent element of the <sn-cms-sn-full-width-video-landing-page> element
 * 
 * do not target the .landing-page-full-width-video selector
 * as that is used on multiple video types
 **/
function getFullWidthHTML5VideoTitle(el) {
	if (!el) {
		return;
	}

	var pagelet = el.parentElement.previousSibling;
	if (!pagelet) {
		return;
	}

	var tag = pagelet.tagName.toLowerCase();
	if (!tag || tag !== 'ish-content-pagelet') {
		return;
	}

	// find the first heading of levels 1 or 2
	var heading = pagelet.querySelector('h1, h2');
	if (!heading) {
		return;
	}

	return heading.innerText;
}
function recordHTML5VideoEvent(event) {
	if (!event) {
		return;
	}
	// the type of the event
	var type = event.type;

	var percent = Math.round((event.target.currentTime / event.target.duration) * 100);

	var title = getHTML5VideoTitle(event.target);

	// make sure dataLayer exists
	window.dataLayer = window.dataLayer || [];
	// record it
	window.dataLayer.push({
		event: 'video_action',
		video_action: type,
		video_percent: percent,
		video_provider: 'native',
		video_title: title ? title : '[undetermined]',
		video_url: event.target.src,
		page_url: window.location.href,
	});
}

if (document.readyState === 'loading') {
	document.addEventListener('DOMContentLoaded', function () {
	  initVideoTracking();
	});
  } else {
	initVideoTracking();
  }

function initVideoTracking() {
	var videos = document.querySelectorAll('video');
	//console.log('init video event helper');
	//console.log(videos);
	if (!videos) return;

	for (var i = 0; i < videos.length; i++) {
		trackHTML5Video(videos[i]);
	}
}
</script>","supportDocumentWrite":"false"}

