// Function to get the fbc from URL parameters or cookies
function getFacebookClickId() {
  var fbc = null;
  // Check URL parameters
  var params = new URLSearchParams(window.location.search);
  if (params.has('fbclid')) {
    fbc = 'fb.1.' + Math.round(new Date().getTime()) + '.' + params.get('fbclid');
    // Optionally store in cookie for future use
    document.cookie = "fbc=" + fbc + "; path=/; max-age=2592000"; // 30 days expiry
  } else {
    // Check cookies if not in URL
    var cookies = document.cookie.split(';');
    for(var i = 0; i < cookies.length; i++) {
      var cookie = cookies[i].trim();
      if (cookie.indexOf("fbc=") == 0) {
        fbc = cookie.substring(4);
        break;
      }
    }
  }
  return fbc;
}

