{"html":"<script type="text/javascript">
var pixelFired = false;

// Replace Measurement ID
var userMeasurementId = "G-CVHE510C11" 

function getGA4SessionId() {
  var cookies = document.cookie.split(';');
  var cookiePattern = userMeasurementId ? 
    new RegExp('_ga_' + userMeasurementId.replace(/^G-/, '') + '=') :
    /_ga_[A-Z0-9]{8,}=/;

  for (var i = 0; i < cookies.length; i++) {
    var cookie = cookies[i].trim();
    if (cookiePattern.test(cookie)) {

      return cookie.split('=')[1].split('.')[2];
    }
  }

  return 'Not Available';
}


function updateSiteVisitPixel(cid, referrerURL, gaInfo) {
  try {
    if (!pixelFired && gaInfo.ga_event === 'page_view') {
      var protocol = window.location.protocol;
      var href = window.location.href;
      var pixel = document.createElement("IMG");
      var pixelUrl = protocol + "//tvspix.com/t.png?&t=" + Date.now() + "&l=tvscientific-pix-o-371aad5c-631b-4384-bfa3-363211fc8074&u3=" + encodeURIComponent(href) + "&u17=" + encodeURIComponent(cid || '') + "&u18=" + encodeURIComponent(referrerURL || '') + "&u19=" + encodeURIComponent(JSON.stringify(gaInfo));
      pixel.setAttribute("src", pixelUrl);
      pixel.setAttribute("alt", "");
      pixel.style.display = "none";
      pixel.style.position = "fixed";
      document.body.appendChild(pixel);
      pixelFired = true;

    }
  } catch (error) {
    console.error('Error updating site visit pixel:', error);
  }
}

function isGoogleAnalyticsResource(resourceName) {
  return resourceName.indexOf('https://www.google-analytics.com/g/collect?') === 0 || resourceName.indexOf('https://analytics.google.com/g/collect?') === 0;
}

function extractGAInfo(resourceName) {
  var url = new URL(resourceName);
  var params = new URLSearchParams(url.search);

  // Get the _ga cookie value using the user-provided Measurement ID if available
  var gaCookiePattern = userMeasurementId ? 
    new RegExp('_ga_' + userMeasurementId.replace(/^G-/, '') + '=([^;]+)') :
    /_ga_[A-Z0-9]{8,}=([^;]+)/;
  var gaCookie = document.cookie.match(gaCookiePattern);
  var gaCid = gaCookie ? gaCookie[1].split('.').slice(-2).join(".") : 'Not Available';
  var gaSid = getGA4SessionId();

  return {
    ga_script_loaded: "1",
    ga_measurement_id: userMeasurementId || params.get('tid') || 'Not Available',
    ga_sid: gaSid,
    ga_event: params.get('en') || 'Not Available',
    ga_timestamp: params.get('_p') ? params.get('_p') + '000' : 'Not Available',
    ga_pageurl: params.get('dl') ? decodeURIComponent(params.get('dl')) : 'Not Available',
    ga_cid: gaCid,
    ga_ref: params.get('dr') ? decodeURIComponent(params.get('dr')) : 'Not Available',
  };
}

function logResourceDetails(resource) {
  if (resource && resource.name && isGoogleAnalyticsResource(resource.name)) {
    try {
      var gaInfo = extractGAInfo(resource.name);

      updateSiteVisitPixel(gaInfo.ga_cid, gaInfo.ga_ref, gaInfo);

    } catch (error) {
      console.error('Error logging Google Analytics resource details:', error);
    }
  }
}

function logResources() {
  if (performance && performance.getEntriesByType) {
    try {
      var resources = performance.getEntriesByType('resource');

      for (var i = 0; i < resources.length; i++) {
        logResourceDetails(resources[i]);
      }
    } catch (error) {
      console.error('Error logging resources:', error);
    }
  } else {
    console.warn('Performance API not supported. Unable to log resources.');
  }
}

function fireEventAfterDelay() {
  setTimeout(function () {
    if (pixelFired) {
      return
    }
    var gaInfo = {
      ga_script_loaded: "0",
      ga_measurment_id: 'Not Available',
      ga_sid: 'Not Available',
      ga_event: 'Not Available',
      ga_timestamp: 'Not Available',
      ga_pageurl: 'Not Available',
      ga_cid: 'Not Available',
      ga_ref: 'Not Available'
    };
    updateSiteVisitPixel('', gaInfo.ga_ref, gaInfo);

    pixelFired = true;
  }, 1000);
}

if (typeof PerformanceObserver !== 'undefined') {
  try {
    var observer = new PerformanceObserver(function (list) {
      var entries = list.getEntries();
      for (var i = 0; i < entries.length; i++) {
        var entry = entries[i];
        logResourceDetails(entry);
        if (isGoogleAnalyticsResource(entry.name)) {
          var gaInfo = extractGAInfo(entry.name);

          updateSiteVisitPixel(gaInfo.ga_cid, gaInfo.ga_pageurl, gaInfo);
        }
      }
    });
    observer.observe({ entryTypes: ['resource'] });

  } catch (error) {
    console.error('Error creating PerformanceObserver:', error);
  }
} else {
  console.warn('PerformanceObserver not supported. Unable to observe resource timing entries.');
}

if (document.readyState === 'loading') {
  document.addEventListener('load', function () {
    initTVSCientific();
  });
} else {
  initTVSCientific();
}

function initTVSCientific() {
  logResources();
  fireEventAfterDelay();
}

