{"html":"<script>
	window.dataLayer = window.dataLayer || [];

	var report25 = false,
		report50 = false,
		report75 = false,
		report99 = false;


	setTimeout(function () {
		var videos = document.querySelectorAll('video');

		for (var i = 0; i <= videos.length; i++) {
			var element = videos[i];
			if (!element) {
				continue;
			}

			//We don't want to re-init if this trigger fires a second time
			if (element.percentPlayed >= 0) {
				continue;
			}

			element.percentPlayed = 0;

			window.dataLayer.push({
				event: 'video_in_viewport',
				video_action: 'visible',
				video_url: element.src,
                page_url: window.location.href
			});

			element.addEventListener('timeupdate', trackVideoProgress);
		}
	}, 100);

	function trackVideoProgress(event) {
		if (!event) {
			return false;
		}

		var time = event.target.currentTime;
		var duration = event.target.duration;
		var p = time / duration;
		var percentPlayed = Math.min(100, Math.ceil(p * 100));

		if (percentPlayed <= event.target.percentPlayed) {
			return;
		}

		if (percentPlayed >= 25 && !report25) {
			pushVideoProgress(25)
			report25 = true;
		} else if (percentPlayed >= 50 && !report50) {
			pushVideoProgress(50);
			report50 = true;
		} else if (percentPlayed >= 75 && !report75) {
			pushVideoProgress(75);
			report75 = true;
		} else if (percentPlayed >= 99 && !report99) {
			pushVideoProgress(99);
			report99 = true;
		}

		function pushVideoProgress(percentage) {
			window.dataLayer.push({
				event: 'video_progress',
				video_action: 'progress',
				video_percent: percentage,
				video_url: event.target.src,
                page_url: window.location.href
			});
		}

		event.target.percentPlayed = percentPlayed;
	}
</script>","supportDocumentWrite":"false"}

