// Function to listen for the "OneTrustLoaded" event
function listenForOneTrustLoaded(callback) {
    // Check if the dataLayer is available
    if (window.dataLayer) {
        // Check for the "OneTrustLoaded" event in the dataLayer
        var foundOneTrustLoaded = false;

        for (var i = 0; i < window.dataLayer.length; i++) {
            if (window.dataLayer[i].event === "OneTrustLoaded") {
                foundOneTrustLoaded = true;
                break;
            }
        }

        if (foundOneTrustLoaded) {
            callback(); // Call the provided callback function if the event is found
        } else {
            // Set up an interval to keep checking for the event
            var intervalId = setInterval(function() {
                for (var i = 0; i < window.dataLayer.length; i++) {
                    if (window.dataLayer[i].event === "OneTrustLoaded") {
                        clearInterval(intervalId); // Stop the interval
                        callback(); // Call the callback function
                        break;
                    }
                }
            }, 1000); // Check every 1 second (adjust as needed)
        }
    }
}

// Listen for "OneTrustLoaded" event and push "first_pageload" event to dataLayer
